  fontWeight: '20px',
  textTransform: 'capitalize',
  margin: '40px',
  display: 'flex',
  justifyContent: 'center',
  fontFamily: 'Verdana, Geneva',
  }
}

ReactDOM.render(
  <>
    <h1 style={heading}>My name is Madiha.</h1>
  </>,
  document.getElementById("root")
);
